import React, {Component} from 'react';


class Navbar extends Component{

    render(){

        const  { items } = this.props;
        const listItem = items.map(item => {
            return(
                <div>
                    <h1>Name: { item.name }</h1>
                    <h1>Age: { item.age }</h1>
                    <h1>Sex: { item.sex}</h1>

                </div>
            )

        })


        return(

            <div className={'navbar'}>
                {listItem}
            </div>

        );
    }
}

export default Navbar;
